import React, { useEffect, useParams, useHistory } from 'react';

function TitleSearch() {
  const { url } = useParams();
  const history = useHistory();

  useEffect(() => {
    history.push(url);
  }, [history, url]);

  return (
    <div>
      {/* Your component JSX goes here */}
    </div>
  );
}

export default TitleSearch;
